BEGIN;
CREATE SCHEMA IF NOT EXISTS on1_force;

CREATE TABLE IF NOT EXISTS on1_force.on1_force_traits(
   token_id     SMALLINT PRIMARY KEY,
   background   TEXT,
   body         TEXT,
   domain       TEXT,
   extra        TEXT,
   eyes         TEXT,
   face         TEXT,
   hair         TEXT,
   head         TEXT,
   helmet       TEXT,
   mouth        TEXT,
   spirit       SMALLINT,
   strength     SMALLINT,
   style        SMALLINT,
   type         TEXT,
   wear         TEXT,
   image_url    TEXT
);


CREATE INDEX IF NOT EXISTS on1_force_traits_idx ON on1_force.on1_force_traits USING BRIN (token_id);

COMMIT;
